const host = window.location.hostname

let URL;

if (window.location.hostname.includes('ibict.br')) {
  URL = `https://${window.location.host}/${window.location.pathname.split('/')[1]}/api/v1`;
} else {
  URL = `http://${window.location.host}/${window.location.pathname.split('/')[1]}/api/v1`;
}



document.addEventListener('DOMContentLoaded', function () {

  function getIdFromURL() {
    const currentUrl = window.location.href;
    const idMatch = currentUrl.match(/Record\/(\d+-[a-fA-F0-9-]+)/);

    if (idMatch && idMatch[1]) {
      return idMatch[1];
    } else {
      console.log('ID não encontrado na URL');
      return null;
    }
  }

  document.getElementById('pdfButton').addEventListener('click', function () {
    const revistaId = getIdFromURL();
    gerarPDF(revistaId);
  });


});

async function gerarPDF(revistaId) {
  // const revistaId = getIdFromURL();

  if (!revistaId) {
    console.log('ID da revista não encontrado na URL.');
    return;
  }
  // console para verificar o id da revista
  // console.log("id", revistaId);
  try {
    let RecordURL = `record?id=${revistaId}&field[]=title&field[]=publisher&field[]=issns&field[]=urls&field[]=sealColor&field[]=lastModified&field[]=dc.contributor.editor&field[]=dc.rights.preprint&field[]=dc.rights.authorpostprint&field[]=dc.rights.journalpostprint&field[]=dc.rights.access&field[]=dc.rights.creativecommons&field[]=dc.identifier.email&field[]=dc.description.phone`;

    let response = await fetch(`${URL}/${RecordURL}`);


    let data = await response.json();

    if (!response.ok) {
      console.error(`Erro na requisição: ${response.statusText}`);
      return;
    }

    // console para verificar os dados vindos da api
    // console.log("O que está vindo da api", data)

    if (data && data.records.length > 0) {
      gerarPDfComDados(data.records[0]);
    } else {
      console.log('Nenhum dado retornado da API.');
    }
  } catch (error) {
    console.error('Ocorreu um erro ao buscar a revista:', error);
  }
}




function gerarPDfComDados(record) {
  if (window.jspdf && window.jspdf.jsPDF) {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();


    const titulo = record['title'] || 'Título não disponível';
    const publicacao = record['publisher'] || 'Editora não disponível';
    const issn = record['issns'] && record['issns'].length > 0 ? record['issns'][0] : 'ISSN não disponível';
    const urlObj = record['urls'] && record['urls'].length > 0 ? record['urls'][0] : null;
    const link = urlObj ? urlObj.url : 'URL indisponível';
    const selo = record['sealColor'] || 'Selo indisponível';
    const dataModificacoes = record['lastModified'] || 'Não disponível ';
    const editor = record['dc.contributor.editor'] || 'Editor não disponível';
    const preprint = record['dc.rights.preprint'] || 'Informação indisponível';
    const authorPostprint = record['dc.rights.authorpostprint'] || 'Informação indisponível';
    // console.log(authorPostprint)
    const journalPostprint = record['dc.rights.journalpostprint'] || 'Informação indisponível';
    // console.log(journalPostprint)
    const tipoAcesso = record['dc.rights.access'] || 'Informação indisponível';
    const licencaCC = record['dc.rights.creativecommons'] || 'Informação indisponível';
    const email = record['dc.identifier.email'] || 'Email indisponível';
    const telefone = record['dc.description.phone'] || 'Telefone indisponível';

    const imgInicio = 'data:image/png;base64,';
    const imgFim = 'data:image/png;base64,';


    const margin = 15;
    const pageWidth = doc.internal.pageSize.width;
    const pageHeight = doc.internal.pageSize.height;
    const lineHeight = 6;
    const paragrafoSpacing = 4;

    const maxLineWidth = pageWidth - 2 * margin;

    doc.setFontSize(12); 
    doc.addImage(imgInicio, 'PNG', 20, 10, 50, 20);

    let y = 50;

    function addTextWithCheck(text, isBold = false, fontSize = 12) {
      doc.setFontSize(fontSize);
      doc.setFont('helvetica', isBold ? 'bold' : 'normal');
    
      const lines = doc.splitTextToSize(text, maxLineWidth); 
    
      lines.forEach(line => {
        if (y + lineHeight > pageHeight - margin) {
          doc.addPage();
          y = margin;  
        }
    
    
        doc.text(line, margin, y, { align: 'justify' });
        
        y += lineHeight;
      });
    
      y += paragrafoSpacing;
    }
    
    function addLabelAndValue(label, value) {
      if (y + lineHeight > pageHeight - margin) {
        doc.addPage();
        y = margin; 
      }
    
      doc.setFontSize(12);
      doc.setFont('helvetica', 'bold');
      doc.text(label, margin, y);
    
      const labelWidth = doc.getTextWidth(label);
    
  
      const valueLines = doc.splitTextToSize(value, maxLineWidth - labelWidth - margin); 
      
      valueLines.forEach((line, index) => {
        if (index === 0) {
          doc.setFont('helvetica', 'normal');
          doc.text(line, margin + labelWidth + 1, y); 
        } else {
          y += lineHeight;
          doc.text(line, margin, y, { align: 'justify' });
        }
      });
    
      y += lineHeight + paragrafoSpacing;
    }

    addTextWithCheck(`${titulo}`, true, 16);
    addTextWithCheck(`O (a) ${titulo} é uma publicação oficial do (a) ${publicacao}, registrada sob o número de ISSN ${issn}, e tem como editor (a) responsável ${editor}.`);
    addTextWithCheck(`Sua página oficial é: ${link}`);
    addTextWithCheck(`O (a)  ${titulo} aplica a seguinte política em relação ao depósito e acesso de seus artigos em repositórios digitais/institucionais:`);
    addLabelAndValue('Versão preprint: ', `${preprint}`);
    addLabelAndValue('Versão pós-print do autor: ', `${authorPostprint}`);
    addLabelAndValue('Versão pós-print da revista: ', `${journalPostprint}`);
    addTextWithCheck(`Por conta destas permissões, foi atribuído o seguinte selo à (ao) ${titulo}: `);
    addTextWithCheck(`${selo}`, true);
    addTextWithCheck(`O (a) ${titulo} permite o seguinte tipo de acesso aos documentos publicados: `);
    addTextWithCheck(`${tipoAcesso}`, true);
    addTextWithCheck(`Estes documentos são licenciados sob a seguinte Licença Creative Commons: `);
    addTextWithCheck(`${licencaCC}`, true);
    addTextWithCheck(`A última data e horário de atualização destes dados foi: ${dataModificacoes}`); 
    addTextWithCheck(`Para dúvidas ou mais informações, entre em contato com a equipe editorial por meio dos seguintes canais:`, true);
    addTextWithCheck(`E-mail: ${email}`);
    addTextWithCheck(`Telefone: ${telefone}`);

    // Adicionar imagem de final
    const imgFimWidth = 50;
    const imgFimHeight = 30;
    const imgFimX = pageWidth - imgFimWidth - margin;
    const imgFimY = pageHeight - imgFimHeight - margin;

    doc.addImage(imgFim, 'PNG', imgFimX, imgFimY, imgFimWidth, imgFimHeight);

    // Salvar o arquivo PDF com o nome da revista selecionada, preservando os caracteres acentuados
    const tituloFormatado = titulo.normalize("NFD").replace(/[\u0300-\u036f]/g, "").replace(/[^a-zA-Z0-9 ]/g, "").replace(/\s+/g, '_');
    doc.save(`${tituloFormatado}.pdf`);


  } else {
    alert("Erro no carregamento do jsPDF");
  }
}